from random import *


class Solution:
    # def searchInsert_mod_LC(selfself, nums, target):
    def searchInsert(selfself, nums, target):
        """This is an modified ver of a LC solution that used list comprehension.
            I expanded it to not use list comp so that it doesn't have to traverse the entire list
        """
        a_lst = []
        for elem in nums:
            if elem < target:
                a_lst.append(elem)
            else:
                break
        return len(a_lst)


    def searchInsert_MINE(self, nums, target):
    # def searchInsert(self, nums, target):
        """
        :type nums: List[int]
        :type target: int
        :rtype: int
        """
        if len(nums) == 0 or target < nums[0]:
            return 0
        nums_info = []
        for (i, elem) in enumerate(nums):
            nums_info.append({'idx': i, 'val': elem})
        last = nums_info[-1]
        while last.get('val') > target:
            mid_i = len(nums_info) // 2
            mid_val = nums_info[mid_i].get('val')
            last = nums_info[-1]
            if last.get('val') == target:
                return last.get('idx')
            if target == mid_val:
                return nums_info[mid_i].get('idx')
            if target < mid_val:
                nums_info = nums_info[:mid_i]
            else:
                nums_info = nums_info[mid_i:]
        if last.get('val') == target:
            return last.get('idx')
        return last.get('idx') + 1


